import React from 'react';

const companies = ['BMW', 'Triumph', 'Enfield'];

function TopBikes() {
  return (
    <div>
      <h1>Top Picks from Premium Brands</h1>
      <ul className="top-bike-list">
        {companies.map((brand) => (
          <li key={brand} className="top-bike-item">{brand}</li>
        ))}
      </ul>
      <p className="note">Search them on the Home page to see details!</p>
    </div>
  );
}

export default TopBikes;
